const BannerData = {
    AgencyText : [
        {
            id: 1,
            btitle : 'Você quer mais leads e vendas?',
            description : 'Você quer mais tráfego, leads e vendas? Coloque sua URL abaixo se você quer crescer o tráfego do seu site e a sua receita.',
        }
    ],
}
export default BannerData;
